import './App.css';
import FilterBar from './components/filter-bar';
import Header from './components/header';
import PieChartCard from './components/pie-chart-card';

function App() {
  return (
    <>
      <Header />
      <FilterBar />
      <PieChartCard
        name=""
        labels={['Feminino', 'Masculino', 'Outro']}
        series={[40, 30, 30]}
      />
    </>
  );
}

export default App;
